/*Table structure for table `doctor` */

DROP TABLE IF EXISTS `doctor`;

CREATE TABLE `doctor` (
  `doctor_id` varchar(255) NOT NULL,
  `salutation` varchar(255) DEFAULT NULL,
  `first_name` varchar(255) DEFAULT NULL,
  `last_name` varchar(255) DEFAULT NULL,
  `clinic_name` varchar(255) DEFAULT NULL,
  `qualification` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `additional_address` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `state` varchar(255) DEFAULT NULL,
  `country` varchar(255) DEFAULT NULL,
  `zip` varchar(255) DEFAULT NULL,
  `latitude` varchar(255) DEFAULT NULL,
  `longitude` varchar(255) DEFAULT NULL,
  `speciality1` varchar(255) DEFAULT NULL,
  `speciality2` varchar(255) DEFAULT NULL,
  `clinic_id` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`doctor_id`),
  KEY `fk_doctor_speciality1` (`speciality1`),
  KEY `fk_doctor_speciality2` (`speciality2`),
  KEY `fk_doctor_clinic` (`clinic_id`),
  CONSTRAINT `fk_doctor_clinic` FOREIGN KEY (`clinic_id`) REFERENCES `clinic` (`clinic_id`),
  CONSTRAINT `fk_doctor_speciality1` FOREIGN KEY (`speciality1`) REFERENCES `speciality` (`SPECIALITY_CODE`),
  CONSTRAINT `fk_doctor_speciality2` FOREIGN KEY (`speciality2`) REFERENCES `speciality` (`SPECIALITY_CODE`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

ALTER TABLE doctor DROP PRIMARY KEY, ADD PRIMARY KEY(`doctor_id`, `clinic_id`);


