DROP VIEW IF EXISTS `group_insurance_plan_details`;

CREATE OR REPLACE
    /*[ALGORITHM = {UNDEFINED | MERGE | TEMPTABLE}]
    [DEFINER = { user | CURRENT_USER }]
    [SQL SECURITY { DEFINER | INVOKER }]*/
    VIEW `group_insurance_plan_details`
    AS
(SELECT ig.insured_group_id AS insuredGroupId, ig.plan_start_date AS planStartDate, ig.plan_end_date AS planEndDate,
ig.policy_no AS policyNumber, p.insurance_code AS insuranceCode, p.insurance_name AS insuranceName, p.id,
p.payer_type AS payerType, p.`INSURANCE_SHORT_NAME` AS insuranceShortName,
p.`AUTHORIZATION_NO` AS authorizationNumber, p.`STATUTORY_INFO` AS statutoryInfo, p.`MODE_OF_CLAIM` AS modeOfClaim,
p.`CONTACT_NAME` AS contactName, p.`ADDRESS1` AS address1, p.`ADDRESS2` AS address2, p.`STATE_ID` AS stateId,
p.`DISTRICT_ID` AS districtId, p.`PINCODE` AS pincode, p.`COUNTRY_ID` AS countryId, p.`FAX_NO` AS faxNo, p.`EMAIL` AS emailId,
p.`WEBSITE` AS website, p.`PO_BOX_NO` AS poBoxNumber, hp.id AS healthPolicyId, hp.policy_name AS healthPolicyName,
bp.`ID` AS benefitPlanId, bp.`BENEFIT_NAME` AS benefitPlan,`bp`.`AGE` AS `age`,
`bp`.`RELATION` AS `relation`,`bp`.`GENDER` AS `gender`
FROM insured_group ig JOIN payer p ON ig.payer_id = p.id JOIN `health_policy` hp
ON ig.health_policy_id = hp.id JOIN `benefit_plan` bp ON  ig.health_policy_id  = bp.health_policy_id);

