CREATE OR REPLACE
    /*[ALGORITHM = {UNDEFINED | MERGE | TEMPTABLE}]
    [DEFINER = { user | CURRENT_USER }]
    [SQL SECURITY { DEFINER | INVOKER }]*/
    VIEW `module_service_details`
    AS
(SELECT sm.id AS serviceId, sm.service_name AS serviceName, sm.parent_id AS parentId, sm.code AS serviceCode, sm.op_service AS
opService, m.id AS moduleId, m.MODULE_NAME AS moduleName, m.SUM_INSURED AS sumAssured, m.FROM_AGE AS fromAge, m.HEALTH_POLICY_ID AS healthPolicyId,
m.TO_AGE AS toAge, m.PRE_HOSPITALISATION_LIMIT AS preHospitalisationLimit, m.PRE_HOSPITALISATION_DAYS AS
preHospitalisationDays, m.POST_HOSPITALISATION_LIMIT AS postHospitalisationLimit, m.POST_HOSPITALISATION_DAYS AS
postHospitalisationDays, m.WAITING_PERIOD AS waitingPeriod, m.EXCLUSIONPERIOD AS exclusionPeriod, m.SPECIAL_CLAUSE AS
specialClause, m.SPECIAL_EXCLUSIONS AS specialExclusions, m.NOTES AS notes, m.IS_MATERNITY AS isMaternity, m.IS_ACTIVE AS isActive, m.copay_amount AS copayAmount, m.copay_percentage AS copayPercentage, m.deductable_amount AS deductableAmount,
m.deductable_percentage AS deductablePercentage, m.authorization AS authorization, m.authorization_inclusive_consultation
AS authorizationInclusiveConsultation,m.authorization_amount AS authorizationAmount, m.authorization_required_consultation
AS authorizationRequiredConsultation, m.compute_by AS computeBy  FROM `modules` m JOIN `module_service_assoc` msa ON
msa.module_id = m.id JOIN `service_master` sm ON sm.id = msa.service_id);


