    /*[ALGORITHM = {UNDEFINED | MERGE | TEMPTABLE}]
    [DEFINER = { user | CURRENT_USER }]
    [SQL SECURITY { DEFINER | INVOKER }]*/
    VIEW `city_state_country`
    AS
(SELECT c.id AS cityId,c.city,c.city_code AS cityCode,s.id AS stateId,s.state, s.state_code AS stateCode, cn.id AS countryId,
