CREATE OR REPLACE VIEW `service_price_view` AS (
SELECT  `a`.`ID` AS `ID`,  `a`.`SERVICE_NAME` AS `SERVICE_NAME`,  `a`.`PARENT_ID` AS `PARENT_ID`,  `a`.`CODE` AS `CODE`,  `a`.`OP_SERVICE` AS `OP_SERVICE`,  `c`.`BENEFIT_ID` AS `BENEFIT_ID`,  `c`.`MODULE_ID` AS `MODULE_ID`,  `d`.`BENEFIT_NAME` AS `BENEFIT_NAME`,  `d`.`HEALTH_POLICY_ID` AS `HEALTH_POLICY_ID`,  `e`.`POLICY_NO` AS `POLICY_NO`,  `e`.`PLAN_START_DATE` AS `PLAN_START_DATE`,  `e`.`PLAN_END_DATE` AS `PLAN_END_DATE`,  `e`.`PAYER_ID` AS `PAYER_ID` FROM ((((`service_master` `a`  JOIN `module_service_assoc` `b`  ON ((`a`.`ID` = `b`.`SERVICE_ID`)))  LEFT JOIN `benefit_module_assoc` `c`  ON ((`b`.`MODULE_ID` = `c`.`MODULE_ID`)))  LEFT JOIN `benefit_plan` `d`  ON ((`c`.`BENEFIT_ID` = `d`.`ID`)))  LEFT JOIN `insured_group` `e`  ON ((`d`.`HEALTH_POLICY_ID` = `e`.`HEALTH_POLICY_ID`))));

