/* Function  structure for function  `getDBNameFromJdbcUrl` */

/*!50003 DROP FUNCTION IF EXISTS `getDBNameFromJdbcUrl` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getDBNameFromJdbcUrl`(jdbcUrl VARCHAR(255)) RETURNS varchar(255) CHARSET utf8
BEGIN
	DECLARE dbName VARCHAR(255);
	SET dbName = SUBSTRING_INDEX(SUBSTRING(jdbcUrl,1, LOCATE('?',jdbcUrl)-1),'/', -1);
	RETURN dbName;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `addPaymentTransactionForAppointment` */

/*!50003 DROP PROCEDURE IF EXISTS  `addPaymentTransactionForAppointment` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `addPaymentTransactionForAppointment`(IN transactionType VARCHAR(255), IN transactionAmount DECIMAL(19,3), IN transactionTimestamp TIMESTAMP, IN isysTrackingRef VARCHAR(255), IN afyaId varchar(255), in apptClinicId varchar(255), in apptDoctorId varchar(255), in apptSlot varchar(255))
BEGIN

	INSERT INTO `payment_gateway_transaction` (`transaction_type`, `transaction_amount`, `transaction_timestamp`,
	`isys_tracking_ref`, `isys_merchant_ref`, `isys_payment_status`, `isys_payment_status_timestamp`, `username`,
	`afya_id`, `appointment_clinic_id`, `appointment_doctor_id`, `appointment_slot`, `subscription_id`)
	VALUES
	(transactionType, transactionAmount, transactionTimestamp, isysTrackingRef, NULL,
	null, null, null, afyaId, apptClinicId,
	apptDoctorId, apptSlot, null);

	SELECT LAST_INSERT_ID() as paymentId;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `getDoctorTariff` */

/*!50003 DROP PROCEDURE IF EXISTS  `getDoctorTariff` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getDoctorTariff`(IN clinicId VARCHAR(255), doctorId bigint(20), visitTypeName VARCHAR(255), IN afyaId VARCHAR(255))
BEGIN

	DECLARE template TEXT;
	DECLARE finalQry LONGTEXT;


	SET template = CONCAT("SELECT {CLINIC_DB}.clinic_tariff.BILLABLE_AMOUNT, {CLINIC_DB}.clinic_tariff.*
			 FROM {CLINIC_DB}.clinic_tariff
			 INNER JOIN {CLINIC_DB}.slot_type ON {CLINIC_DB}.slot_type.ID = {CLINIC_DB}.clinic_tariff.VISIT_TYPE
			 -- INNER JOIN {CLINIC_DB}.patient_category ON {CLINIC_DB}.patient_category.PATIENT_CODE = {CLINIC_DB}.clinic_tariff.PATIENT_CATEGORY
			 INNER JOIN {CLINIC_DB}.patient ON {CLINIC_DB}.patient.TARIFF_CODE = {CLINIC_DB}.clinic_tariff.TARIFF_CATEGORY
			 WHERE {CLINIC_DB}.clinic_tariff.DOCTOR = ", doctorId
			 , " AND {CLINIC_DB}.slot_type.NAME = '", visitTypeName, "'"
			 , " AND {CLINIC_DB}.patient.AFYA_ID = '", afyaId, "'"
			 , " AND {CLINIC_DB}.clinic_tariff.PATIENT_CATEGORY = '01' AND {CLINIC_DB}.clinic_tariff.TARIFF_CATEGORY = '00'");

	SET group_concat_max_len = 4294967295;


	SELECT qry INTO finalQry FROM
	(SELECT  REPLACE(template, '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
	FROM clinic
	INNER JOIN tenant ON tenant.tenant_id = clinic.tenant_id
	WHERE clinic.clinic_id = clinicId) tmpTbl;

	SET @finalQry = finalQry;
	PREPARE stmt FROM @finalQry;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

    END */$$
DELIMITER ;

