/* Procedure structure for procedure `getInvoiceRecords` */

/*!50003 DROP PROCEDURE IF EXISTS  `getInvoiceRecords` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getInvoiceRecords`(IN afyaId VARCHAR(255), IN fromDate DATE, IN toDate DATE, IN clinicName VARCHAR(255), IN doctorName VARCHAR(255))
BEGIN

	DECLARE clinicInvoiceHistoryTemplate TEXT;
	DECLARE clinicInvoiceHistoryQuery TEXT;
	DECLARE clinicInvoiceQueryFinal TEXT;
	DECLARE queryConsolidated TEXT;


	SET clinicInvoiceHistoryTemplate = CONCAT("SELECT 'Clinic' AS providerType, {CLINIC_DB}.invoice.INVOICE_NUMBER, {CLINIC_DB}.invoice.INVOICE_DATE, {CLINIC_DB}.patient.AFYA_ID, '{CLINIC_NAME}' AS provider, CONCAT(IFNULL({CLINIC_DB}.person.FIRST_NAME, ''), ' ', IFNULL({CLINIC_DB}.person.MIDDLE_NAME, ''), ' ', IFNULL({CLINIC_DB}.person.LAST_NAME, '')) AS doctor,
		{CLINIC_DB}.invoice.AMOUNT AS invoiceAmount, (IFNULL({CLINIC_DB}.invoice.TOTAL_COPAY_AMOUNT, 0) + IFNULL({CLINIC_DB}.invoice.TOTAL_DEDUCTABLE_AMOUNT, 0)) AS patientPayable, ({CLINIC_DB}.invoice.AMOUNT - (IFNULL({CLINIC_DB}.invoice.TOTAL_COPAY_AMOUNT, 0) + IFNULL({CLINIC_DB}.invoice.TOTAL_DEDUCTABLE_AMOUNT, 0))) AS insurancePayable
		FROM {CLINIC_DB}.invoice
		INNER JOIN {CLINIC_DB}.patient ON {CLINIC_DB}.patient.ID = {CLINIC_DB}.invoice.PATIENT
		INNER JOIN {CLINIC_DB}.person ON {CLINIC_DB}.person.ID = {CLINIC_DB}.invoice.CONSULTANT
		WHERE {CLINIC_DB}.patient.AFYA_ID='", afyaId ,"'",
		" AND ('", fromDate, "' IS NULL OR {CLINIC_DB}.invoice.INVOICE_DATE >= '", fromDate,
		"') AND ('", toDate, "' IS NULL OR {CLINIC_DB}.invoice.INVOICE_DATE <= '", toDate,
		"') AND ('", clinicName, "' IS NULL OR CHAR_LENGTH('", clinicName, "') = 0 OR LOCATE('", clinicName, "', '{CLINIC_NAME}') <> 0 ",
		") AND ('", doctorName, "' IS NULL OR CHAR_LENGTH('", doctorName, "') = 0 OR LOCATE('", doctorName, "', CONCAT(IFNULL({CLINIC_DB}.person.FIRST_NAME, ''), ' ', IFNULL({CLINIC_DB}.person.MIDDLE_NAME,''), ' ', IFNULL({CLINIC_DB}.person.LAST_NAME, ''))) <> 0); ");


	SET group_concat_max_len = 4294967295;



	SELECT GROUP_CONCAT(tnt.qry SEPARATOR '
	UNION
	')
	INTO clinicInvoiceHistoryQuery FROM
	(SELECT  REPLACE(REPLACE(clinicInvoiceHistoryTemplate, '{CLINIC_NAME}', clinic.clinic_name), '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
		FROM tenant
		INNER JOIN clinic ON clinic.tenant_id = tenant.tenant_id
		INNER JOIN patient_clinic_assoc ON patient_clinic_assoc.clinic_id = clinic.clinic_id
		WHERE patient_clinic_assoc.afya_id = afyaId
	) tnt;


	SET @clinicInvoiceHistoryQuery = clinicInvoiceHistoryQuery;
	PREPARE stmt FROM @clinicInvoiceHistoryQuery;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
    END */$$
DELIMITER ;

