/* Procedure structure for procedure `getPatientActivePrescription` */

/*!50003 DROP PROCEDURE IF EXISTS  `getPatientActivePrescription` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getPatientActivePrescription`(IN afyaId VARCHAR(255), IN fromDate DATETIME, IN toDate DATETIME
		, IN drugName VARCHAR(255), IN clinicName VARCHAR(255), IN doctorName VARCHAR(255))
BEGIN

	DECLARE template TEXT;
	DECLARE finalQry LONGTEXT;

	DECLARE fromDateStr VARCHAR(255);
	DECLARE toDateStr VARCHAR(255);
	DECLARE drugNameStr VARCHAR(255);
	DECLARE clinicNameStr VARCHAR(255);
	DECLARE doctorNameStr VARCHAR(255);

	SET fromDateStr = IFNULL(fromDate, '');
	SET toDateStr = IFNULL(toDate, '');
	SET drugNameStr = IFNULL(drugName, '');
	SET clinicNameStr = IFNULL(clinicName, '');
	SET doctorNameStr = IFNULL(doctorName, '');

	SET template = CONCAT("(SELECT prx.ID AS prescriptionId, pat.afya_id AS afyaId, cli.clinic_id AS clinicId, cli.clinic_name AS clinicName
			, per.ID AS doctorId, per.FIRST_NAME AS doctorFirstName, per.MIDDLE_NAME AS doctorMiddleName, per.LAST_NAME AS doctorLastName
			, DATE_FORMAT(prx.START_DATE,'%d-%m-%Y') AS startDate, DATE_FORMAT(prx.END_DATE,'%d-%m-%Y') AS endDate, per.MOBILE_NUMBER AS doctorMobileNumber, per.OFFICE_PHONE AS doctorOfficeNumber
			, rxfrq.DESCRIPTION AS rxFrequency, rxqual.DESCRIPTION AS rxFrequencyQualifier, prx.NUMBER_OF_DAYS AS numberOfDays, prx.TOTAL_COUNT AS totalCount
			, drug.TRADE_NAME AS drugName
		FROM {CLINIC_DB}.patient_rx prx
		INNER JOIN {CLINIC_DB}.Patient pat ON pat.ID = prx.PATIENT_ID
		INNER JOIN patient_clinic_assoc assoc ON assoc.afya_id = pat.afya_id
		INNER JOIN clinic cli ON cli.clinic_id = assoc.clinic_id
		INNER JOIN {CLINIC_DB}.person per ON per.ID = prx.PROVIDER_ID
		INNER JOIN {CLINIC_DB}.frequency rxfrq ON rxfrq.ID = prx.FREQUENCY_ID
		INNER JOIN {CLINIC_DB}.frequency_qualifier rxqual ON rxqual.ID = prx.FREQUENCY_QUALIFIER_ID
		INNER JOIN {CLINIC_DB}.drug ON drug.ID = prx.DRUG_ID
		-- INNER JOIN {CLINIC_DB}.slot_type st ON st.ID = sch.SOAP_NOTE_TYPE
		WHERE prx.STATUS = 'ACTIVE' AND (CHAR_LENGTH('", fromDateStr, "') = 0 OR prx.START_DATE >= '", fromDateStr, "')
			AND (CHAR_LENGTH('", toDateStr, "') = 0 OR prx.START_DATE <= '", toDateStr, "')
			AND (CHAR_LENGTH('", drugNameStr, "') = 0 OR LOCATE('", drugNameStr, "', prx.DRUG_NAME) > 0)
			AND (CHAR_LENGTH('", clinicNameStr, "') = 0 OR LOCATE('", clinicNameStr, "', cli.clinic_name) > 0)
			AND (CHAR_LENGTH('", doctorNameStr, "') = 0 OR LOCATE('", doctorNameStr, "', CONCAT(per.FIRST_NAME, ' ', IFNULL(per.MIDDLE_NAME, ''), ' ', per.LAST_NAME)) > 0)
			AND assoc.afya_id = '",afyaId, "'
		ORDER BY prx.START_DATE ASC, prx.START_DATE ASC)");


	SET group_concat_max_len = 4294967295;



	SELECT GROUP_CONCAT(tmpTbl.qry SEPARATOR '
	UNION
	')
	INTO finalQry FROM
	(SELECT REPLACE(template, '{CLINIC_DB}', getDBNameFromJdbcUrl(tenant.jdbc_url)) qry
	FROM clinic
	INNER JOIN tenant ON tenant.tenant_id = clinic.tenant_id AND clinic.clinic_id = '1'
	INNER JOIN patient_clinic_assoc pca ON pca.afya_id = afyaId) tmpTbl;


	-- select finalQry;	-- for testing

	SET @finalQry = finalQry;
	PREPARE stmt FROM @finalQry;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `getPatientSpendingByServices` */

/*!50003 DROP PROCEDURE IF EXISTS  `getPatientSpendingByServices` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getPatientSpendingByServices`(IN afyaId VARCHAR(255), in fromDate DATE, in toDate DATE)
BEGIN


	DECLARE baseTemplate TEXT;
	DECLARE consultationTemplate TEXT;
	DECLARE procedureTemplate TEXT;
	DECLARE consultationQuery TEXT;
	DECLARE procedureQuery TEXT;
	DECLARE finalQuery TEXT;


	set baseTemplate = CONCAT("SELECT {CLINIC_DB}.getPatientPayable({CLINIC_DB}.invoice_item.ID) AS patientPayable, ({CLINIC_DB}.invoice_item.AMOUNT - {CLINIC_DB}.getPatientPayable({CLINIC_DB}.invoice_item.ID)) AS insurancePayable, {CLINIC_DB}.invoice_item.AMOUNT AS amount -- , {CLINIC_DB}.invoice_item.*
		FROM {CLINIC_DB}.invoice_item
		INNER JOIN {CLINIC_DB}.invoice ON {CLINIC_DB}.invoice.ID = {CLINIC_DB}.invoice_item.INVOICE_ID
		INNER JOIN {CLINIC_DB}.patient ON {CLINIC_DB}.patient.ID = {CLINIC_DB}.invoice.PATIENT
		WHERE {CLINIC_DB}.invoice_item.ITEM_TYPE = '{ITEM_TYPE}' AND {CLINIC_DB}.patient.afya_id = '",
		afyaId, "'",
		" AND ('", fromDate, "' IS NULL OR {CLINIC_DB}.invoice.INVOICE_DATE >= '", fromDate, "')
		AND ('", toDate, "' IS NULL OR {CLINIC_DB}.invoice.INVOICE_DATE <= '", toDate, "') ");

	SET consultationTemplate = REPLACE(baseTemplate, "{ITEM_TYPE}", "OPD_CONSULTATION");
	SET procedureTemplate = REPLACE(baseTemplate, "{ITEM_TYPE}", "OPD_PROCEDURE");


	SET group_concat_max_len = 4294967295;




	SELECT GROUP_CONCAT(tnt.qry SEPARATOR '
	UNION
	')
	INTO consultationQuery FROM
	(SELECT  REPLACE(consultationTemplate, '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
		FROM tenant
		INNER JOIN clinic on clinic.tenant_id = tenant.tenant_id
		INNER JOIN patient_clinic_assoc on patient_clinic_assoc.clinic_id = clinic.clinic_id
		WHERE patient_clinic_assoc.afya_id = afyaId
	) tnt;






	SELECT GROUP_CONCAT(tnt.qry SEPARATOR '
	UNION
	')
	INTO procedureQuery FROM
	(SELECT  REPLACE(procedureTemplate, '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
	FROM tenant
		INNER JOIN clinic ON clinic.tenant_id = tenant.tenant_id
		INNER JOIN patient_clinic_assoc ON patient_clinic_assoc.clinic_id = clinic.clinic_id
		WHERE patient_clinic_assoc.afya_id = afyaId
	) tnt;



	set finalQuery = concat(
		"SELECT 'Consultation' AS Service, SUM(IFNULL(patientPayable, 0)) AS patientPayable, SUM(IFNULL(insurancePayable, 0)) AS insurancePayable, SUM(IFNULL(amount, 0)) AS amount FROM "
		, "(", consultationQuery, ")  tmpTbl1", "
			UNION
		", "SELECT 'Investigations' AS Service, SUM(IFNULL(patientPayable, 0)) AS patientPayable, SUM(IFNULL(insurancePayable, 0)) AS insurancePayable, SUM(IFNULL(amount, 0)) AS amount FROM "
		, "(", procedureQuery, ") tmpTbl2"
	);



	SET @finalQuery = finalQuery;
	PREPARE stmt FROM @finalQuery;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `getPatientSpendingByServicesConsolidated` */

/*!50003 DROP PROCEDURE IF EXISTS  `getPatientSpendingByServicesConsolidated` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getPatientSpendingByServicesConsolidated`(IN afyaId VARCHAR(255), IN fromDate DATE, IN toDate DATE)
BEGIN
	SELECT 'Consultation' AS Service, IfNULL(SUM(IFNULL(inv.PATIENT_PAYABLE_OPD_CONSULTATION, 0)),0) AS patientPayable, IFNULL(SUM(IFNULL(inv.INSURANCE_PAYABLE_OPD_CONSULTATION,0)),0) AS insurancePayable, IFNULL(SUM(IFNULL(inv.AMOUNT_OPD_CONSULTATION,0)),0) AS amount
	FROM consolidated_invoice inv
	WHERE inv.AFYA_ID = afyaId AND (fromDate IS NULL OR inv.INVOICE_DATE >= fromDate) AND (toDate IS NULL OR inv.INVOICE_DATE <= toDate)
	UNION
	SELECT 'Procedure' AS Service, IFNULL(SUM(IFNULL(inv.PATIENT_PAYABLE_OPD_PROCEDURE,0)),0) AS patientPayable, IFNULL(SUM(IFNULL(inv.INSURANCE_PAYABLE_OPD_PROCEDURE,0)),0) AS insurancePayable, IFNULL(SUM(IFNULL(inv.AMOUNT_OPD_PROCEDURE,0)),0) AS amount
	FROM consolidated_invoice inv
	WHERE inv.AFYA_ID = afyaId AND (fromDate IS NULL OR inv.INVOICE_DATE >= fromDate) AND (toDate IS NULL OR inv.INVOICE_DATE <= toDate);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `getPatientVisitCountByFacility` */

