DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getPatientVisitCountByFacility`(IN afyaId VARCHAR(255), IN fromDate DATE, IN toDate DATE)
BEGIN

	DECLARE clinicVisitsTemplate TEXT;
	DECLARE clinicVisitsQuery TEXT;
	DECLARE clinicVisitsQueryFinal TEXT;
	DECLARE queryConsolidated TEXT;




	SET clinicVisitsTemplate = CONCAT("SELECT '{CLINIC_DB}' AS clinicDBName, {CLINIC_DB}.patient.AFYA_ID, {CLINIC_DB}.schedule.STATUS -- , {CLINIC_DB}.schedule.*
		FROM {CLINIC_DB}.schedule
		INNER JOIN {CLINIC_DB}.patient ON {CLINIC_DB}.patient.ID = {CLINIC_DB}.schedule.PATIENT_ID
		WHERE {CLINIC_DB}.schedule.STATUS = 'SOAPSIGNEDOUT' AND {CLINIC_DB}.patient.AFYA_ID='", afyaId ,"'",
		" AND ('", fromDate, "' IS NULL OR {CLINIC_DB}.schedule.START_DATE >= '", fromDate, "') AND ('",
		toDate, "' IS NULL OR {CLINIC_DB}.schedule.START_DATE <= '", toDate, "') ");


	SET group_concat_max_len = 4294967295;




	SELECT GROUP_CONCAT(tnt.qry SEPARATOR '
	UNION
	')
	INTO clinicVisitsQuery FROM
	(SELECT  REPLACE(clinicVisitsTemplate, '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
		FROM tenant
		INNER JOIN clinic ON clinic.tenant_id = tenant.tenant_id
		INNER JOIN patient_clinic_assoc ON patient_clinic_assoc.clinic_id = clinic.clinic_id
		WHERE patient_clinic_assoc.afya_id = afyaId
	) tnt;


	SET @qryClinicVisitsCount = CONCAT("SELECT COUNT(1) INTO @clinicVisitsCount FROM (", clinicVisitsQuery, ") clinicVisits2;");
	SET @qryClinicVisitsClinicCount = CONCAT("SELECT COUNT(DISTINCT clinicDBName) INTO @clinicVisitsClinicCount FROM (", clinicVisitsQuery, ") clinicVisits1;");

	SET @qryConsolidate = CONCAT(
	"SELECT 'Clinics', @clinicVisitsCount AS visitCount, @clinicVisitsClinicCount AS facilityCount
	UNION
	SELECT 'Pharmacies', '' AS visitCount, '' AS facilityCount
	UNION
	SELECT 'Labs', '' AS visitCount, '' AS facilityCount;");


	PREPARE stmt FROM @qryClinicVisitsCount; EXECUTE stmt; DEALLOCATE PREPARE stmt;
	PREPARE stmt FROM @qryClinicVisitsClinicCount; EXECUTE stmt; DEALLOCATE PREPARE stmt;
	PREPARE stmt FROM @qryConsolidate; EXECUTE stmt; DEALLOCATE PREPARE stmt;



    END */$$
DELIMITER ;

/* Procedure structure for procedure `getPatientVisitCountByFacilityConsolidated` */

/*!50003 DROP PROCEDURE IF EXISTS  `getPatientVisitCountByFacilityConsolidated` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getPatientVisitCountByFacilityConsolidated`(IN afyaId VARCHAR(255), IN fromDate DATE, IN toDate DATE)
BEGIN

	DECLARE clinicVisitsCount INT;
	DECLARE clinicVisitsClinicCount INT;

	SELECT COUNT(1) INTO clinicVisitsCount FROM consolidated_schedule sch
	WHERE sch.STATUS = 'SOAPSIGNEDOUT' AND sch.AFYA_ID = 'KWT25'
		AND (fromDate IS NULL OR fromDate >= sch.START_DATE) AND (toDate IS NULL OR toDate <= sch.START_DATE);
	SELECT COUNT(DISTINCT sch.CLINIC_ID) INTO clinicVisitsClinicCount FROM consolidated_schedule sch
	WHERE sch.STATUS = 'SOAPSIGNEDOUT' AND sch.AFYA_ID = 'KWT25'
		AND (fromDate IS NULL OR fromDate >= sch.START_DATE) AND (toDate IS NULL OR toDate <= sch.START_DATE);

	SELECT 'Clinics', clinicVisitsCount AS visitCount, clinicVisitsClinicCount AS facilityCount
	UNION
	SELECT 'Pharmacies', '0' AS visitCount, '0' AS facilityCount
	UNION
	SELECT 'Labs', '0' AS visitCount, '0' AS facilityCount;

    END */$$
DELIMITER ;

