			, per.ID AS doctorId, per.FIRST_NAME AS doctorFirstName, per.MIDDLE_NAME AS doctorMiddleName, per.LAST_NAME AS doctorLastName
			, DATE_FORMAT(sch.START_DATE,'%d-%m-%Y') AS appointmentDate, CONCAT(DATE_FORMAT(sch.START_TIME, '%H:%i'), ' - ', DATE_FORMAT(sch.END_TIME, '%H:%i')) AS appointmentSlot
			, per.MOBILE_NUMBER AS doctorMobileNumber, per.OFFICE_PHONE AS doctorOfficeNumber -- , afya_clinic.schedule.*
