/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `getVisitHistory`(IN afyaId VARCHAR(255), IN fromDate DATE, IN toDate DATE, IN clinicName VARCHAR(255), IN doctorName varchar(255), IN visitType varchar(255))
BEGIN

