	DECLARE clinicVisitsQueryFinal TEXT;
	DECLARE queryConsolidated TEXT;
	DECLARE fromDateStr VARCHAR(100);
	DECLARE toDateStr VARCHAR(100);



	SET fromDateStr = IFNULL(fromDate, '');
	SET toDateStr = IFNULL(toDate, '');
	SET clinicName = IFNULL(clinicName, '');
	SET doctorName = IFNULL(doctorName, '');
	set visitType = ifnull(visitType, '');


	SET clinicVisitHistoryTemplate = CONCAT("SELECT 'Clinic' AS providerType, {CLINIC_DB}.patient.AFYA_ID, '{CLINIC_NAME}' AS provider, {CLINIC_DB}.slot_type.NAME AS visitType, {CLINIC_DB}.schedule.START_DATE AS visitDate, {CLINIC_DB}.schedule.START_TIME AS visitStartTime,  {CLINIC_DB}.schedule.END_TIME AS visitEndTime, CONCAT(IFNULL({CLINIC_DB}.person.FIRST_NAME, ''), ' ', IFNULL({CLINIC_DB}.person.MIDDLE_NAME, ''), ' ', IFNULL({CLINIC_DB}.person.LAST_NAME, '')) AS doctor
		FROM {CLINIC_DB}.schedule
		INNER JOIN {CLINIC_DB}.patient ON {CLINIC_DB}.patient.ID = {CLINIC_DB}.schedule.PATIENT_ID
		INNER JOIN {CLINIC_DB}.person ON {CLINIC_DB}.person.ID = {CLINIC_DB}.schedule.PERSON_ID
		INNER JOIN {CLINIC_DB}.slot_type ON {CLINIC_DB}.slot_type.ID = {CLINIC_DB}.schedule.SOAP_NOTE_TYPE
		WHERE {CLINIC_DB}.schedule.STATUS = 'SOAPSIGNEDOUT' AND {CLINIC_DB}.patient.AFYA_ID='", afyaId ,"'",
		" AND (CHAR_LENGTH('", fromDateStr, "') = 0 OR {CLINIC_DB}.schedule.START_DATE >= '", fromDateStr,
		"') AND (CHAR_LENGTH('", toDateStr, "') = 0 OR {CLINIC_DB}.schedule.START_DATE <= '", toDateStr,
		"') AND (CHAR_LENGTH('", clinicName, "') = 0 OR LOCATE('", clinicName, "', '{CLINIC_NAME}') > 0 ",
		") AND (CHAR_LENGTH('", doctorName, "') = 0 OR LOCATE('", doctorName, "', CONCAT(IFNULL({CLINIC_DB}.person.FIRST_NAME, ''), ' ', IFNULL({CLINIC_DB}.person.MIDDLE_NAME,''), ' ', IFNULL({CLINIC_DB}.person.LAST_NAME, ''))) > 0 ",
		") AND (CHAR_LENGTH('", visitType, "') = 0 OR LOCATE('", visitType, "',{CLINIC_DB}.slot_type.NAME) > 0); ");


	SET group_concat_max_len = 4294967295;



	SELECT GROUP_CONCAT(tnt.qry SEPARATOR '
	UNION
	')
	INTO clinicVisitHistoryQuery FROM
	(SELECT  REPLACE(REPLACE(clinicVisitHistoryTemplate, '{CLINIC_NAME}', clinic.clinic_name), '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
		FROM tenant
		INNER JOIN clinic ON clinic.tenant_id = tenant.tenant_id
		INNER JOIN patient_clinic_assoc ON patient_clinic_assoc.clinic_id = clinic.clinic_id
		WHERE patient_clinic_assoc.afya_id = afyaId
	) tnt;




	SET @clinicVisitHistoryQuery = clinicVisitHistoryQuery;
	PREPARE stmt FROM @clinicVisitHistoryQuery;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `getVisitHistoryConsolidated` */

/*!50003 DROP PROCEDURE IF EXISTS  `getVisitHistoryConsolidated` */;

DELIMITER $$

DELIMITER $$

USE `afya_portal1`$$

DROP PROCEDURE IF EXISTS `getVisitHistoryConsolidated`$$

CREATE PROCEDURE `getVisitHistoryConsolidated`(IN afyaId VARCHAR(255), IN fromDate DATE, IN toDate DATE, IN clinicName VARCHAR(255), IN doctorName VARCHAR(255), IN visitType VARCHAR(255))
BEGIN
	-- SET fromDateStr = IFNULL(fromDate, '');
	-- SET toDateStr = IFNULL(toDate, '');
	SET clinicName = IFNULL(clinicName, '');
	SET doctorName = IFNULL(doctorName, '');
	SET visitType = IFNULL(visitType, '');
	SELECT 'Clinic' AS providerType, sch.AFYA_ID, clinic.clinic_name AS provider, clinic.tenant_id AS clinicTenantId,
	clinic.address AS providerAddress, clinic.additional_address AS providerAdditionalAddress, clinic.mobile AS providerMobile, clinic.email AS providerEmail,sch.VISIT_TYPE AS visitType
		, sch.START_DATE AS visitDate, sch.START_TIME AS visitStartTime,  sch.END_TIME AS visitEndTime
		, CONCAT(DATE_FORMAT(sch.START_TIME, '%H:%i'), ' - ', DATE_FORMAT(sch.END_TIME, '%H:%i')) AS appointmentSlot
		-- , CONCAT(IFNULL(doctor.first_name, ''), ' ', IFNULL('doctor.middle_name', ''), ' '
		, CONCAT(IFNULL(doctor.first_name, ''), ' ', IFNULL(doctor.last_name, '')) AS doctor
		, DATE_FORMAT(sch.START_TIME, '%Y-%m-%d %H:%i:%s') AS visitStartDateTime
		, DATE_FORMAT(sch.END_TIME,'%Y-%m-%d %H:%i:%s') AS visitEndDateTime, doctor.doctor_id AS doctorId
		FROM consolidated_schedule sch
		INNER JOIN clinic ON clinic.clinic_id = sch.CLINIC_ID
		INNER JOIN doctor ON doctor.doctor_id = sch.PERSON_ID AND doctor.clinic_id = sch.CLINIC_ID
		WHERE sch.STATUS = 'SOAPSIGNEDOUT' AND sch.AFYA_ID=afyaId
			AND (fromDate IS NULL OR sch.START_DATE >= fromDate)
			AND (toDate IS NULL OR sch.START_DATE <= toDate)
			AND (CHAR_LENGTH(clinicName) = 0 OR LOCATE(clinicName, clinic.clinic_name) > 0)
			AND (CHAR_LENGTH(doctorName) = 0 OR LOCATE(doctorName, CONCAT(IFNULL(doctor.FIRST_NAME, ''), ' ', IFNULL('doctor.MIDDLE_NAME',''), ' ', IFNULL(doctor.LAST_NAME, ''))) > 0)
			AND (CHAR_LENGTH(visitType) = 0 OR LOCATE(visitType, sch.VISIT_TYPE) > 0);
    END$$

DELIMITER ;

