/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `ScheduleJob_populateConsolidatedInvoice`()
BEGIN

	DECLARE selectQueryTemplateBase TEXT;
	DECLARE selectQueryTemplateForInsert TEXT;
	DECLARE selectQueryTemplateForUpdate TEXT;
	DECLARE selectQueryForInsert TEXT;
	DECLARE selectQueryForUpdate TEXT;
	DECLARE insertQuery TEXT;
	DECLARE updateQuery TEXT;

	SET group_concat_max_len = 4294967295;

	SET selectQueryTemplateBase = "

	SELECT 	cinv.ID, cinv.IS_ACTIVE, cinv.CREATED_BY, cinv.CREATE_TX_TIMESTAMP, cinv.DEACTIVATION_REASON, cinv.UPDATE_BY, cinv.UPDATED_TX_TIMESTAMP, cinv.VERSION, cinv.BILL_DATE,
		cinv.COLLECTED_PRICE, cinv.COLLECTED_BY_USER, cinv.EXTERNAL_PATIENT, cinv.EXTERNAL_PROVIDER, cinv.GENERATED_ON, cinv.INVOICE_DATE, cinv.INVOICE_NUMBER,
		cinv.INVOICE_STATUS, cinv.INVOICE_TYPE, cinv.IP_NUMBER, cinv.IS_ADVANCE, cinv.IS_DEDUCTED, cinv.ITEM_ID, cinv.ITEM_TYPE, cinv.REFERRAL_CONSULTANT_ID, cinv.AMOUNT,
		cinv.WRITE_OFF_BY, cinv.WRITE_OFF_DATE, cinv.WRITTENOFF_PRICE, cinv.WRITTEN_OFF_REASON, cinv.DEACTIVATEDBY, cinv.CONSULTANT, cinv.CONTRACT, cinv.LOCATION_ID,
		cinv.PATIENT, cinv.TOTAL_AUTHORIZATION_AMOUNT, cinv.TOTAL_COPAY_AMOUNT, cinv.TOTAL_DEDUCTABLE_AMOUNT, cinv.PATIENT_INSURANCE_ID, cinv.SELECTED_HIS_MODULE_ID,
		cinv.CONCESSION_AMOUNT, cinv.CONCESSION_AUTHORISER, cinv.CONCESSION_REASON, cinv.CONCESSION_TYPE, cinv.CANCEL_AUTHORISER, cinv.CANCEL_REASON, cinv.TOTAL_REFERRAL_AMOUNT_PAYABLE,
		cinv.TOTAL_REFERRAL_AMOUNT_TOBE_PAID, pat.AFYA_ID, 'Clinic' AS PROVIDER_TYPE, '{CLINIC_NAME}' AS PROVIDER_NAME,
