		(cinv.AMOUNT - (IFNULL(cinv.TOTAL_COPAY_AMOUNT, 0) + IFNULL(cinv.TOTAL_DEDUCTABLE_AMOUNT, 0))) AS INSURANCE_PAYABLE,
		(SELECT IFNULL(SUM({CLINIC_DB}.getPatientPayable(invitm.ID)),0) FROM {CLINIC_DB}.invoice_item invitm WHERE invitm.ITEM_ID = cinv.ITEM_ID AND invitm.ITEM_TYPE = 'OPD_CONSULTATION') AS PATIENT_PAYABLE_OPD_CONSULTATION,
