		(SELECT IFNULL(SUM(invitm.AMOUNT),0) FROM {CLINIC_DB}.invoice_item invitm WHERE invitm.ITEM_ID = cinv.ITEM_ID AND invitm.ITEM_TYPE = 'OPD_CONSULTATION') AS AMOUNT_OPD_CONSULTATION,
		(SELECT IFNULL(SUM({CLINIC_DB}.getPatientPayable(invitm.ID)),0) FROM {CLINIC_DB}.invoice_item invitm WHERE invitm.ITEM_ID = cinv.ITEM_ID AND invitm.ITEM_TYPE = 'OPD_PROCEDURE') AS PATIENT_PAYABLE_OPD_PROCEDURE,
		(SELECT IFNULL(SUM(invitm.AMOUNT - {CLINIC_DB}.getPatientPayable(invitm.ID)),0) FROM {CLINIC_DB}.invoice_item invitm WHERE invitm.ITEM_ID = cinv.ITEM_ID AND invitm.ITEM_TYPE = 'OPD_PROCEDURE') AS INSURANCE_PAYABLE_OPD_PROCEDURE,
		(SELECT IFNULL(SUM(invitm.AMOUNT),0) FROM {CLINIC_DB}.invoice_item invitm WHERE invitm.ITEM_ID = cinv.ITEM_ID AND invitm.ITEM_TYPE = 'OPD_PROCEDURE') AS AMOUNT_OPD_PROCEDURE,
		'{CLINIC_ID}' AS CLINIC_ID, NOW() AS JOB_REFERENCE
	FROM {CLINIC_DB}.invoice cinv
	INNER JOIN {CLINIC_DB}.patient pat ON pat.ID = cinv.PATIENT
	INNER JOIN {CLINIC_DB}.person per ON per.ID = cinv.CONSULTANT
	WHERE cinv.{TIMESTAMP_COLUMN} > (SELECT IFNULL(MAX(cinv1.{TIMESTAMP_COLUMN}), '1970-01-01 00:00:01') FROM consolidated_invoice cinv1 WHERE cinv1.CLINIC_ID = '{CLINIC_ID}' ) ";

	SET selectQueryTemplateForInsert = REPLACE(selectQueryTemplateBase, '{TIMESTAMP_COLUMN}', 'CREATE_TX_TIMESTAMP');
	SET selectQueryTemplateForUpdate = REPLACE(selectQueryTemplateBase, '{TIMESTAMP_COLUMN}', 'UPDATED_TX_TIMESTAMP');



	SELECT GROUP_CONCAT(tnt.qry SEPARATOR '
	UNION
	')
	INTO selectQueryForInsert FROM
	(SELECT  REPLACE(REPLACE(REPLACE(selectQueryTemplateForInsert, '{CLINIC_NAME}', clinic.clinic_name), '{CLINIC_ID}', clinic.clinic_id), '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
