		`COLLECTED_PRICE`, `COLLECTED_BY_USER`, `EXTERNAL_PATIENT`, `EXTERNAL_PROVIDER`, `GENERATED_ON`, `INVOICE_DATE`, `INVOICE_NUMBER`, `INVOICE_STATUS`,
		`INVOICE_TYPE`, `IP_NUMBER`, `IS_ADVANCE`, `IS_DEDUCTED`, `ITEM_ID`, `ITEM_TYPE`, `REFERRAL_CONSULTANT_ID`, `AMOUNT`, `WRITE_OFF_BY`, `WRITE_OFF_DATE`,
		`WRITTENOFF_PRICE`, `WRITTEN_OFF_REASON`, `DEACTIVATEDBY`, `CONSULTANT`, `CONTRACT`, `LOCATION_ID`, `PATIENT`, `TOTAL_AUTHORIZATION_AMOUNT`,
		`TOTAL_COPAY_AMOUNT`, `TOTAL_DEDUCTABLE_AMOUNT`, `PATIENT_INSURANCE_ID`, `SELECTED_HIS_MODULE_ID`, `CONCESSION_AMOUNT`, `CONCESSION_AUTHORISER`,
		`CONCESSION_REASON`, `CONCESSION_TYPE`, `CANCEL_AUTHORISER`, `CANCEL_REASON`, `TOTAL_REFERRAL_AMOUNT_PAYABLE`, `TOTAL_REFERRAL_AMOUNT_TOBE_PAID`,
		`AFYA_ID`, `PROVIDER_TYPE`, `PROVIDER_NAME`, `DOCTOR_NAME`, `PATIENT_PAYABLE`, `INSURANCE_PAYABLE`, `PATIENT_PAYABLE_OPD_CONSULTATION`,
		`INSURANCE_PAYABLE_OPD_CONSULTATION`,`AMOUNT_OPD_CONSULTATION`,`PATIENT_PAYABLE_OPD_PROCEDURE`,`INSURANCE_PAYABLE_OPD_PROCEDURE`,`AMOUNT_OPD_PROCEDURE`,
		`CLINIC_ID`, `JOB_REFERENCE`
		)";

	SET insertQuery = CONCAT(insertQuery, "
		SELECT * FROM
		(", selectQueryForInsert, ") tmptbl");





	SET updateQuery = CONCAT("
			UPDATE consolidated_invoice coninv
			LEFT JOIN (", selectQueryForUpdate, ") inv ON inv.ID = coninv.ID AND inv.CLINIC_ID = coninv.CLINIC_ID AND inv.UPDATED_TX_TIMESTAMP >  coninv.UPDATED_TX_TIMESTAMP
			SET
