				coninv.AMOUNT = inv.AMOUNT ,
				coninv.WRITE_OFF_BY = inv.WRITE_OFF_BY ,
				coninv.WRITE_OFF_DATE = inv.WRITE_OFF_DATE ,
				coninv.WRITTENOFF_PRICE = inv.WRITTENOFF_PRICE ,
				coninv.WRITTEN_OFF_REASON = inv.WRITTEN_OFF_REASON ,
				coninv.DEACTIVATEDBY = inv.DEACTIVATEDBY ,
