				coninv.SELECTED_HIS_MODULE_ID = inv.SELECTED_HIS_MODULE_ID ,
				coninv.CONCESSION_AMOUNT = inv.CONCESSION_AMOUNT ,
				coninv.CONCESSION_AUTHORISER = inv.CONCESSION_AUTHORISER ,
				coninv.CONCESSION_REASON = inv.CONCESSION_REASON ,
				coninv.CONCESSION_TYPE = inv.CONCESSION_TYPE ,
				coninv.CANCEL_AUTHORISER = inv.CANCEL_AUTHORISER ,
				coninv.CANCEL_REASON = inv.CANCEL_REASON ,
				coninv.TOTAL_REFERRAL_AMOUNT_PAYABLE = inv.TOTAL_REFERRAL_AMOUNT_PAYABLE ,
				coninv.TOTAL_REFERRAL_AMOUNT_TOBE_PAID = inv.TOTAL_REFERRAL_AMOUNT_TOBE_PAID ,
				coninv.AFYA_ID = inv.AFYA_ID ,
				coninv.PROVIDER_TYPE = inv.PROVIDER_TYPE ,
				coninv.PROVIDER_NAME = inv.PROVIDER_NAME ,
				coninv.DOCTOR_NAME = inv.DOCTOR_NAME ,
				coninv.PATIENT_PAYABLE = inv.PATIENT_PAYABLE ,
				coninv.INSURANCE_PAYABLE = inv.INSURANCE_PAYABLE ,
				coninv.PATIENT_PAYABLE_OPD_CONSULTATION = inv.PATIENT_PAYABLE_OPD_CONSULTATION ,
				coninv.INSURANCE_PAYABLE_OPD_CONSULTATION = inv.INSURANCE_PAYABLE_OPD_CONSULTATION ,
				coninv.AMOUNT_OPD_CONSULTATION = inv.AMOUNT_OPD_CONSULTATION ,
				coninv.PATIENT_PAYABLE_OPD_PROCEDURE = inv.PATIENT_PAYABLE_OPD_PROCEDURE ,
				coninv.INSURANCE_PAYABLE_OPD_PROCEDURE = inv.INSURANCE_PAYABLE_OPD_PROCEDURE ,
				coninv.AMOUNT_OPD_PROCEDURE = inv.AMOUNT_OPD_PROCEDURE ,
