	SET selectQueryTemplateBase = "
		SELECT csch.ID, csch.IS_ACTIVE, csch.CREATED_BY, csch.CREATE_TX_TIMESTAMP, csch.DEACTIVATION_REASON, csch.UPDATE_BY
			, csch.UPDATED_TX_TIMESTAMP, csch.VERSION, csch.CHIEF_COMPLAINT, csch.COMMENTS, csch.END_TIME, csch.LENGTH, csch.PATIENT_CLASS
			, csch.PATIENT_CONTACT_NUMBER, csch.SCHEDULE_TYPE, csch.SEQUENCE_NUMBER, csch.SIGNED_IN_TIME, csch.SIGNED_OUT_TIME, csch.START_DATE
			, csch.START_TIME, csch.STATUS, csch.DEACTIVATEDBY, csch.INTERNAL_REFERRAL, csch.LAST_PATIENT_VISIT_ID, csch.LOCATION_ID, csch.PATIENT_ID
			, csch.PATIENT_LAB_ORDER_ID, csch.PERSON_ID, csch.REFERRAL, csch.SOAP_NOTE_TYPE, csch.PRIORITY, csch.CANCEL_REASON, csch.PRIORITY_MAIL_SENT
			, csch.WALKIN_APPOINTMENT, csch.CONFIRMED, csch.RESCHEDULED, slt.NAME AS VISIT_TYPE, pat.AFYA_ID AS AFYA_ID, {CLINIC_ID} AS CLINIC_ID, NOW() AS JOB_REFERENCE
		FROM {CLINIC_DB}.schedule csch
		INNER JOIN {CLINIC_DB}.patient pat ON pat.ID = csch.PATIENT_ID
