	SET selectQueryTemplateForUpdate = REPLACE(selectQueryTemplateBase, '{TIMESTAMP_COLUMN}', 'UPDATED_TX_TIMESTAMP');



	SELECT GROUP_CONCAT(tnt.qry SEPARATOR '
	UNION
	')
	INTO selectQueryForInsert FROM
	(SELECT  REPLACE(REPLACE(selectQueryTemplateForInsert, '{CLINIC_ID}', clinic.clinic_id), '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
		FROM tenant
		INNER JOIN clinic ON clinic.tenant_id = tenant.tenant_id AND clinic.clinic_id = '1'
	) tnt;



	SELECT GROUP_CONCAT(tnt.qry SEPARATOR '
	UNION
	')
	INTO selectQueryForUpdate FROM
	(SELECT  REPLACE(REPLACE(selectQueryTemplateForUpdate, '{CLINIC_ID}', clinic.clinic_id), '{CLINIC_DB}', getDBNameFromJdbcUrl(jdbc_url)) qry
		FROM tenant
		INNER JOIN clinic ON clinic.tenant_id = tenant.tenant_id  AND clinic.clinic_id = '1'
	) tnt;



	SET insertQuery = "
