		(`ID`, `IS_ACTIVE`, `CREATED_BY`, `CREATE_TX_TIMESTAMP`, `DEACTIVATION_REASON`,
		`UPDATE_BY`, `UPDATED_TX_TIMESTAMP`, `VERSION`, `CHIEF_COMPLAINT`, `COMMENTS`, `END_TIME`, `LENGTH`, `PATIENT_CLASS`, `PATIENT_CONTACT_NUMBER`,
		`SCHEDULE_TYPE`, `SEQUENCE_NUMBER`, `SIGNED_IN_TIME`, `SIGNED_OUT_TIME`, `START_DATE`, `START_TIME`, `STATUS`,
		`DEACTIVATEDBY`, `INTERNAL_REFERRAL`, `LAST_PATIENT_VISIT_ID`, `LOCATION_ID`, `PATIENT_ID`, `PATIENT_LAB_ORDER_ID`,
		`PERSON_ID`, `REFERRAL`, `SOAP_NOTE_TYPE`, `PRIORITY`, `CANCEL_REASON`, `PRIORITY_MAIL_SENT`, `WALKIN_APPOINTMENT`,
		`CONFIRMED`, `RESCHEDULED`, `VISIT_TYPE`, `AFYA_ID`, `CLINIC_ID`, `JOB_REFERENCE`)";

	SET insertQuery = CONCAT(insertQuery, "
		SELECT * FROM
		(", selectQueryForInsert, ") tmptbl");





	SET updateQuery = CONCAT("
			UPDATE consolidated_schedule consch
			LEFT JOIN (", selectQueryForUpdate, ") sch ON sch.ID = consch.ID AND sch.CLINIC_ID = consch.CLINIC_ID AND sch.UPDATED_TX_TIMESTAMP >  consch.UPDATED_TX_TIMESTAMP
			SET
				consch.IS_ACTIVE = sch.IS_ACTIVE ,
				consch.CREATED_BY = sch.CREATED_BY ,
				consch.CREATE_TX_TIMESTAMP = sch.CREATE_TX_TIMESTAMP ,
				consch.DEACTIVATION_REASON = sch.DEACTIVATION_REASON ,
				consch.UPDATE_BY = sch.UPDATE_BY ,
				consch.UPDATED_TX_TIMESTAMP = sch.UPDATED_TX_TIMESTAMP ,
				consch.VERSION = sch.VERSION ,
				consch.CHIEF_COMPLAINT = sch.CHIEF_COMPLAINT ,
				consch.COMMENTS = sch.COMMENTS ,
				consch.END_TIME = sch.END_TIME ,
				consch.LENGTH = sch.LENGTH ,
				consch.PATIENT_CLASS = sch.PATIENT_CLASS ,
				consch.PATIENT_CONTACT_NUMBER = sch.PATIENT_CONTACT_NUMBER ,
				consch.SCHEDULE_TYPE = sch.SCHEDULE_TYPE ,
				consch.SEQUENCE_NUMBER = sch.SEQUENCE_NUMBER ,
				consch.SIGNED_IN_TIME = sch.SIGNED_IN_TIME ,
				consch.SIGNED_OUT_TIME = sch.SIGNED_OUT_TIME ,
				consch.START_DATE = sch.START_DATE ,
				consch.START_TIME = sch.START_TIME ,
				consch.STATUS = sch.STATUS ,
				consch.DEACTIVATEDBY = sch.DEACTIVATEDBY ,
				consch.INTERNAL_REFERRAL = sch.INTERNAL_REFERRAL ,
				consch.LAST_PATIENT_VISIT_ID = sch.LAST_PATIENT_VISIT_ID ,
				consch.LOCATION_ID = sch.LOCATION_ID ,
				consch.PATIENT_ID = sch.PATIENT_ID ,
				consch.PATIENT_LAB_ORDER_ID = sch.PATIENT_LAB_ORDER_ID ,
				consch.PERSON_ID = sch.PERSON_ID ,
				consch.REFERRAL = sch.REFERRAL ,
				consch.SOAP_NOTE_TYPE = sch.SOAP_NOTE_TYPE ,
				consch.PRIORITY = sch.PRIORITY ,
				consch.CANCEL_REASON = sch.CANCEL_REASON ,
				consch.PRIORITY_MAIL_SENT = sch.PRIORITY_MAIL_SENT ,
				consch.WALKIN_APPOINTMENT = sch.WALKIN_APPOINTMENT ,
				consch.CONFIRMED = sch.CONFIRMED ,
				consch.RESCHEDULED = sch.RESCHEDULED ,
				consch.VISIT_TYPE = sch.VISIT_TYPE ,
				consch.AFYA_ID = sch.AFYA_ID ,
				consch.JOB_REFERENCE = sch.JOB_REFERENCE
			WHERE sch.ID = consch.ID AND sch.CLINIC_ID = consch.CLINIC_ID AND sch.UPDATED_TX_TIMESTAMP >  consch.UPDATED_TX_TIMESTAMP; ");




	SET @insertQuery = insertQuery; PREPARE stmt FROM @insertQuery; EXECUTE stmt; DEALLOCATE PREPARE stmt;
	SET @updateQuery = updateQuery; PREPARE stmt FROM @updateQuery; EXECUTE stmt; DEALLOCATE PREPARE stmt;
    END */$$
DELIMITER ;

