/* Procedure structure for procedure `updatePaymentTransactionWithIsysStatus` */

/*!50003 DROP PROCEDURE IF EXISTS  `updatePaymentTransactionWithIsysStatus` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `updatePaymentTransactionWithIsysStatus`(IN paymentId BIGINT(20), IN isysTrackingRef varchar(255), in isysPaymentStatus varchar(255), in isysPaymentStatusTimestamp timestamp, in isysHttpResponseStatus varchar(255))
BEGIN

	DECLARE isUpdated BOOLEAN;
	SET isUpdated = 0;

	update payment_gateway_transaction
	set isys_payment_status = isysPaymentStatus, isys_payment_status_timestamp = isysPaymentStatusTimestamp, isys_payment_status_http_resp_status = isysHttpResponseStatus
	WHERE payment_id = paymentId and isys_tracking_ref = isysTrackingRef;


	set isUpdated = exists(SELECT 1 FROM payment_gateway_transaction pg WHERE pg.payment_id = paymentId AND pg.isys_tracking_ref = isysTrackingRef);
	SELECT isUpdated;
    END */$$
DELIMITER ;

