/* Procedure structure for procedure `getInvoiceDetailsForGivenVisit` */

/*!50003 DROP PROCEDURE IF EXISTS  `getInvoiceDetailsForGivenVisit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `getInvoiceDetailsForGivenVisit`(in clinicId varchar(255), IN afyaId VARCHAR(255), IN doctorId VARCHAR(255), IN startDate DATE, IN startTime DATETIME, IN endTime DATETIME)
BEGIN
	declare queryTemplate text;
	declare finalQuery text;

	set queryTemplate = CONCAT('SELECT p.afya_id AS afyaId, pr.first_name AS patientFirstName, pr.last_name AS patientLastName, p.patient_type AS patientType
	, er.description AS gender , p.civil_id AS civilId, ps.first_name AS providerFirstname, ps.last_name AS providerLastName, i.`ID` AS invoiceId, i.`INVOICE_DATE` AS invoiceDate,
	i.`INVOICE_NUMBER` AS invoiceNumber, i.`AMOUNT` as invoiceAmount, i.`CONCESSION_AMOUNT` as invoiceConsessionAmount, pr.date_of_birth as dateOfBirth,
	ii.`DESCRIPTION` AS invoiceItemDescription, ii.`QUANTITY` AS invoiceItemQuantity, ii.`FACTOR` AS invoiceItemFactor, ii.`AMOUNT` AS
	invoiceItemAmount, ii.`NET_PRICE` AS invoiceItemNetPrice, ii.`INVOICE_ITEM_STATUS` AS invoiceItemStatus, ii.`CONCESSION_AMOUNT`
	AS invoiceItemConcessionAmount, ii.`CONCESSION_TYPE` AS invoiceItemConcessionType, ii.`COPAY_AMOUNT` AS invoiceItemCopayAmount
	,ii.`COPAY_PERCENTAGE` AS invoiceItemCopayPercentage, ii.`DEDUCTABLE_AMOUNT` AS invoiceItemDeductibleAmount, ii.`DEDUCTABLE_PERCENTAGE`
	AS invoiceItemDeductiblePercentage, i.schedule_id AS scheduleId FROM {DB_NAME}.invoice_item ii JOIN
	{DB_NAME}.invoice i ON i.`ID` = ii.`INVOICE_ID` JOIN {DB_NAME}.SCHEDULE s ON s.id = i.schedule_id JOIN {DB_NAME}.patient p ON s.patient_id = p.id JOIN {DB_NAME}.person pr
	ON p.id = pr.id JOIN {DB_NAME}.person ps ON ps.id = s.person_id JOIN {DB_NAME}.enumeration er ON er.ENUM_ID = pr.gender_code and p.afya_id="', afyaId ,'" and s.person_id="', doctorId ,'" and
	s.start_date="', startDate ,'" and s.start_time="', startTime ,'" and s.end_time="', endTime ,'"');

	SELECT  tmpTbl.qry
	INTO finalQuery FROM
	(SELECT REPLACE(queryTemplate, '{DB_NAME}', `getDBNameFromJdbcUrl`(tenant.jdbc_url)) qry,
	`getDBNameFromJdbcUrl`(tenant.jdbc_url), tenant.* FROM tenant WHERE tenant.tenant_id = clinicId) tmpTbl;

	-- select finalQuery;	-- for testing
	-- execute the query
	SET @finalQry = finalQuery;
	PREPARE stmt FROM @finalQry;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `getInvoiceLineItemByInvoiceId` */

/*!50003 DROP PROCEDURE IF EXISTS  `getInvoiceLineItemByInvoiceId` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `getInvoiceLineItemByInvoiceId`(IN clinicId varchar(255), in invoiceId long)
BEGIN

	declare queryTemplate text;
	declare finalQuery text;
	set queryTemplate = concat('select ii.DESCRIPTION as invoiceItemDescription, ii.QUANTITY as invoiceItemQuanity,
	ii.`FACTOR` as invoiceItemFactor, ii.`FACTOR_DESCRIPTION` as factorDescription, ii.`AMOUNT` as invoiceItemAmount,
	ii.`AUTHORIZATION` as authorization, ii.`AUTHORIZATION_AMOUNT` as authorizationAmount, ii.`CONCESSION_AMOUNT` as
	concessionAmount, ii.`CONCESSION_TYPE` as concessionType, ii.`COPAY_AMOUNT` as copayAmount, ii.`COPAY_PERCENTAGE`
	as copayPercentage, ii.`DEDUCTABLE_AMOUNT` as deductibleAmount, ii.`DEDUCTABLE_PERCENTAGE` as deductiblePercentage,
	ii.`NET_PRICE` as netPrice, ii.`ACTUAL_COPAY_AMOUNT` as actualCopayAmount, ii.`ACTUAL_COPAY_PERCENTAGE` as actualCopayPercentage
	from {DB_NAME}.`invoice_item` ii where ii.`INVOICE_ID`="',invoiceId,'"');

	SELECT  tmpTbl.qry
	INTO finalQuery FROM
	(SELECT REPLACE(queryTemplate, '{DB_NAME}', `getDBNameFromJdbcUrl`(tenant.jdbc_url)) qry,
	`getDBNameFromJdbcUrl`(tenant.jdbc_url), tenant.* FROM tenant WHERE tenant.tenant_id = clinicId) tmpTbl;

	-- select finalQuery;	-- for testing
	-- execute the query
	SET @finalQry = finalQuery;
	PREPARE stmt FROM @finalQry;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

    END */$$
DELIMITER ;

